  const [formData, setFormData] = useState({
    idPersona: '',
    nombrePersona: '',
    apellidoPersona: '',
    genero: '',
    telefonoPersona: ''
  });

  

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };
 
  
  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post('./storePersona', formData)
      .then((a) => {
        setFormData({
          idPersona: '',
          nombrePersona: '',
          apellidoPersona: '',
          genero: '',
